import React, { Component } from "react";

import "./Example.css";

export default class Example extends Component {
  render() {
    return (
      <div className="exampleBottle">
        <h3 className="exampleTitle">Exemples de thèmes de mission</h3>
        <div class="section group">
          <div class="col span_1_of_2">
            <ul>
              <li>2 avocats (pelés et avec les noyaux retirés)</li>
              <li>le jus d'un citron</li>
              <li>¼ de concombre, coupé grossièrement</li>
              <li>1 petite tomate, coupée</li>
            </ul>
          </div>
          <div class="col span_1_of_2">This is column 2</div>
        </div>
      </div>
    );
  }
}
